import React from 'react';
import { Segment, Header, Container } from 'semantic-ui-react'

class HeaderComp extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        const { children } = this.props;
        return (
            <Container>
            <Segment inverted>
                <Header textAlign="center">
                    Weather
                </Header>
            </Segment>
                {children}
            </Container>
        );
    }
}

export default HeaderComp;
